export default function Main ({userMain,main2,main1}){

    return(
        <div>
            <div>
                <p>{userMain.firstname + userMain.lastname}</p>
                <p>{`${main2.getFullYear()} - ${main2.getMonth()}`}</p>
                <h2>Tech stack:</h2>
                <ul>
                    {
                        main1.map((e) => (<li>{e}</li>))
                    }

                </ul>
            </div>



        </div>

    );
};
